        $this->formularioDetallesScheduledForDeletion = $this->getFormularioDetalles(new Criteria(), $con)->diff($formularioDetalles);

        foreach ($this->formularioDetallesScheduledForDeletion as $formularioDetalleRemoved) {
            $formularioDetalleRemoved->setFormularioDatos(null);
        }

        $this->collFormularioDetalles = null;
        foreach ($formularioDetalles as $formularioDetalle) {
            $this->addFormularioDetalle($formularioDetalle);
        }

        $this->collFormularioDetalles = $formularioDetalles;
        $this->collFormularioDetallesPartial = false;
    }

    /**
     * Returns the number of related FormularioDetalle objects.
     *
     * @param Criteria $criteria
     * @param boolean $distinct
     * @param PropelPDO $con
     * @return int             Count of related FormularioDetalle objects.
     * @throws PropelException
     */
    public function countFormularioDetalles(Criteria $criteria = null, $distinct = false, PropelPDO $con = null)
    {
        $partial = $this->collFormularioDetallesPartial && !$this->isNew();
        if (null === $this->collFormularioDetalles || null !== $criteria || $partial) {
            if ($this->isNew() && null === $this->collFormularioDetalles) {
                return 0;
            } else {
                if($partial && !$criteria) {
                    return count($this->getFormularioDetalles());
                }
                $query = FormularioDetalleQuery::create(null, $criteria);
                if ($distinct) {
                    $query->distinct();
                }

                return $query
                    ->filterByFormularioDatos($this)
                    ->count($con);
            }
        } else {
            return count($this->collFormularioDetalles);
        }
    }

    /**
     * Method called to associate a FormularioDetalle object to this object
     * through the FormularioDetalle foreign key attribute.
     *
     * @param    FormularioDetalle $l FormularioDetalle
     * @return FormularioDatos The current object (for fluent API support)
     */
    public function addFormularioDetalle(FormularioDetalle $l)
    {
        if ($this->collFormularioDetalles === null) {
            $this->initFormularioDetalles();
            $this->collFormularioDetallesPartial = true;
        }
        if (!$this->collFormularioDetalles->contains($l)) { // only add it if the **same** object is not already associated
            $this->doAddFormularioDetalle($l);
        }

        return $this;
    }

    /**
     * @param	FormularioDetalle $formularioDetalle The formularioDetalle object to add.
     */
    protected function doAddFormularioDetalle($formularioDetalle)
    {
        $this->collFormularioDetalles[]= $formularioDetalle;
        $formularioDetalle->setFormularioDatos($this);
    }

    /**
     * @param	FormularioDetalle $formularioDetalle The formularioDetalle object to remove.
     */
    public function removeFormularioDetalle($formularioDetalle)
    {
        if ($this->getFormularioDetalles()->contains($formularioDetalle)) {
            $this->collFormularioDetalles->remove($this->collFormularioDetalles->search($formularioDetalle));
            if (null === $this->formularioDetallesScheduledForDeletion) {
                $this->formularioDetallesScheduledForDeletion = clone $this->collFormularioDetalles;
                $this->formularioDetallesScheduledForDeletion->clear();
            }
            $this->formularioDetallesScheduledForDeletion[]= $formularioDetalle;
            $formularioDetalle->setFormularioDatos(null);
        }
    }

